import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';

function App() {
    return (
        <Router>
            <Switch>
                <Route path="/" exact>
                    <h1>Cyber Incident Monitoring App</h1>
                </Route>
                <Route path="/dashboard">
                    <h1>Dashboard</h1>
                </Route>
                {/* Add more routes as needed */}
            </Switch>
        </Router>
    );
}
